import React from 'react';
import styles from './DeliveryList.module.css';
import ButtonComponent from './button';

function WalletCard() {
    return (
        <form className={styles.deliveryList}>
            <input type="file" name={"file"} required={true}/>
            <input type="text" name={"size"} placeholder={"Размер товара"} required={true}/>
            <input type="text" name={"weight"} placeholder={"Вес товара"} required={true}/>

            <ButtonComponent className={styles.submitButton}>Подтвердить</ButtonComponent>
        </form>
    );
}

export default WalletCard;
